class Solution(object):
	def productExceptSelf(self, nums):
		"""
		:type nums: List[int]
		:rtype: List[int]
		"""
		N = len(nums)
		# print 'N', N
		res = [1] * N

		p = 1
		for i, num in enumerate(nums):
			res[i] = p
			p = p * num


		p = 1
		for i in xrange(N-1, -1, -1):
			res[i] *= p
			num = nums[i]
			p = p * num

		return res

